import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // First perform a search to get to a page with price filter
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'electronics');
    await page.click('.search-btn');

    // Wait for search results to load
    await page.waitForSelector('.price-filter', { timeout: 5000 });

    // Fill price range filter
    await page.fill('#minPrice', '50');
    await page.fill('#maxPrice', '200');
    await page.click('.apply-filter');

    // Wait for results to update
    await page.waitForTimeout(1000);

    // Take screenshot after applying filter
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_price_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_price_filter_applied.png'));

    // Extract filtered product data
    const filteredProducts = await page.$$eval('.product-card', cards => 
      cards.map(card => ({
        title: card.querySelector('.product-title')?.textContent || '',
        price: card.querySelector('.product-price')?.textContent || ''
      }))
    );

    return {
      success: true,
      action: "Applied price range filter ($50-$200) to electronics search results",
      extractedData: {
        filteredProductsCount: filteredProducts.length,
        sampleProducts: filteredProducts.slice(0, 3)
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price range filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
